import{_ as e,o as r,c as o,O as s}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-4011 Inspection.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-4011.md","filePath":"vacode/3.2-4011.md"}'),t={name:"vacode/3.2-4011.md"},a=s('<h1 id="§-3-2-4011-inspection" tabindex="-1">§ 3.2-4011 Inspection. <a class="header-anchor" href="#§-3-2-4011-inspection" aria-label="Permalink to &quot;§ 3.2-4011 Inspection.&quot;">​</a></h1><p>A. The Commissioner may sample, inspect, analyze, and test seeds transported, sold, or offered for sale for planting purposes and screenings for any purpose. For these purposes, the Commissioner may enter: (i) any premises during business hours; and (ii) any truck or other conveyor by land, by water, or by air at any time when such conveyor is accessible, to access seeds, mixtures of seeds, screenings, and the records required to be kept under § <a href="http://law.lis.virginia.gov/vacode/3.2-4006/" target="_blank" rel="noreferrer">3.2-4006</a>.</p><p>B. The Commissioner shall promptly notify the person who transported, sold, or offered the seed or screenings for sale, or who otherwise violated this article.</p><p>Code 1950, § 3-219.9; 1958, c. 483; 1966, cc. 9, 702, § 3.1-270; 1986, c. 615; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0577" target="_blank" rel="noreferrer">577</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',4),n=[a];function i(c,p,d,l,h,_){return r(),o("div",null,n)}const u=e(t,[["render",i]]);export{m as __pageData,u as default};
